    <script>
        (function(){

        let $ = function(d){return document.getElementById(d)};
        var qrcode;

        function download()
        {
            var anchor = $("download");
            let img = $("_canvas").toDataURL("image/png");
            anchor.download = "qrcode.png";
            anchor.setAttribute('href', img);

            $("output").style.visibility = "visible";
        }

        window.makeCode = function(files)
        {   
            
            if(qrcode != null)
            {
                $("_canvas").parentNode.removeChild($("_canvas"));
                $("qrimg").parentNode.removeChild($("qrimg"));
                qrcode.clear();
            }

            var obj = JSON.parse($("logoSet").value);
            var logoScale = $("logoScale").value;
            var url = $("url").value;
            var qrStyle = document.querySelector('[name=qrStyle]:checked').value;
            var color = $("color").value;

            if(url == "")
                url = "https://gtv.org";

            qrcode = new QRCode($("code"), 
            {
                id: "_canvas",
                logo: obj.image,
                logoSize: obj.size,
                logoScale: logoScale,
                text: url,
                width: 512,
                height: 512,
                border: 10,
                colorDark : color,
                colorLight : "#ffffff",
                correctLevel : QRCode.CorrectLevel.H,
                style : qrStyle,
                callback : download
            });
            
        }

        window.displayLogoScale = function(scale)
        {
            $("scale").innerText = scale+" pixels";
        }
        window.changeColor = function(color)
        {
            var obj = JSON.parse($("logoSet").value);
            $("color").value = obj.color;
        }
        document.addEventListener('DOMContentLoaded', function() 
        {
            $("scale").innerText = $("logoScale").value+" pixels";
            
        }, false);

        })();
        
    </script>
